window.bookSummaryJSON = "<p><b>As the months in the time loop seem to add up without end, Zorian forms alliances with acquaintances old and new in an effort to solve the mystery of the loop and save his city—maybe even the world—from destruction. </b></p> <p>But while his mage skills develop and he pursues more advanced and unusual forms of magic, Zorian must battle necromancers, fanatical cultists, and vicious creatures—all while avoiding the attention of the lich who could kill him...permanently.</p>"; 
